import { OptionSelectType } from '../../types/Interfaces'
import { sortEnum } from '../../types/enums'

export const SelectDateItems: OptionSelectType[] = [
    {
        id: 1,
        value: 'Date',
        name: sortEnum.Date
    },
    {
        id: 2,
        value: 'Title',
        name: sortEnum.Title
    },
    {
        id: 3,
        value: 'Description',
        name: sortEnum.Description
    }
]
